import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="story">
          write story here
        </p>
        <c>
          Learn React
        </c>
      </header>
    </div>
  );
}

export default App;
